import * as UploadApi from '../api/UploadRequest'

export const uploadImage = (data)=> async(dispatch)=> {
    try {
        const response = await UploadApi.uploadImage(data)
        dispatch({ type: 'IMAGE_UPLOAD_SUCCESS', payload: response.data });
    } catch (error) {
        console.log(error)
    }
}
